import frame from '../static/images/Frame.png';
import image10 from '../static/images/image 10.png';
import { styled } from "@mui/material";
import { useState } from "react";

const Input = styled('input')({
    border: 'none',
    borderBottom: '2px solid black',
    marginBottom: '25px',
    fontSize: '22px',
});

const Button = styled('button')({
    marginTop: '20px',
    borderRadius: '5px',
    background: 'black',
    color: 'white',
    textAlign: 'center',
    fontSize: "25px",
    height: "50px",
    cursor: "grab"
})

export default function LoginSignUp() {
    const [acc, toggleAcc] = useState('login');

    const handlebuttonclick = () => {
        if (acc === 'login')
            toggleAcc('signup');
        else
            toggleAcc('login');
    };

    const handlechange = () => {
        let pass = document.getElementById('SignUpPassword');
        let cpass = document.getElementById('confirmPassword');
        console.log(pass.value, cpass.value);
        if (pass.value !== cpass.value) {
            document.getElementById('errormsg').style.display = 'block';
        }
        else {
            document.getElementById('errormsg').style.display = 'none';
        }
    };

    const handlevisibility = (event) => {
        const clickedButton = event.target;
        let buttonid = clickedButton.id;
        if (buttonid === 'visibilitybtn1'){
            const pass1 = document.getElementById('pass1');
            const v1 = document.getElementById('v1');
            v1.innerText = 'visibility_off';
            pass1.type = 'text'
        }
    };

    return (
        <div style={{ display: 'flex', justifyContent: "center" }}>
            <img src={image10} alt='10' />
            <div style={{ display: 'flex', flexDirection: 'column', justifyContent: 'center', position: 'relative', whiteSpace: 'nowrap' }}>
                <div style={{ position: 'absolute', top: '0', width: '100%', display: 'flex', alignItems: 'center' }}>
                    <img src={frame} alt='frame' style={{ width: '24px', height: '24px' }} />
                    <h4 style={{ marginLeft: '1%' }}>User Interface Enhancement for Access Database</h4>
                </div>
                {acc === 'login' ?
                    <div>
                        <h1>Welcome back</h1>
                        <p style={{ fontSize: '20px' }}>Welcome back! Please enter your details.</p>
                        <br />
                        <form style={{ display: 'flex', flexDirection: 'column' }}>
                            <Input type='email' name='Email' placeholder='Email' />
                            <div>
                                <Input id='pass1' style={{ width: '100%' }} type='password' name='Password' placeholder='Password' pattern="\w{8}" title="8 character password" />
                                <i id='visibilitybtn1' onClick={handlevisibility}>
                                    <span id='v1' className="material-icons" style={{ marginLeft: '-30px' }}>
                                        visibility
                                    </span>
                                </i>
                            </div>
                            <a href='#' style={{ alignSelf: 'end' }}>Forgot Password</a>
                            <Button>Log In</Button>
                        </form>
                        <p style={{ textAlign: 'center' }}>
                            Don't have an account?
                            <button onClick={handlebuttonclick}
                                style={{ border: "none", background: 'none', fontSize: '15px', cursor: "grab" }}>
                                <a style={{ marginLeft: '1%' }} href="#">
                                    Signup
                                </a>
                            </button>
                        </p>
                    </div>
                    :
                    <div>
                        <h1>Welcome back</h1>
                        <p style={{ fontSize: '20px' }}>Welcome back! Please enter your details.</p>
                        <br />
                        <form style={{ display: 'flex', flexDirection: 'column' }}>
                            <Input type='text' name='username' placeholder='User Name' />
                            <Input type='email' name='Email' placeholder='Email' />
                            <div>
                                <Input style={{ width: '100%' }} type='password' id='SignUpPassword' placeholder='Password' title="Password must be at least 8 characters, include one uppercase letter, one number, and one special character" required />
                                <i id='visibilitybtn'>
                                    <span className="material-symbols-outlined" style={{ marginLeft: '-30px' }}>
                                        visibility
                                    </span>
                                </i>
                            </div>
                            <p style={{ display: 'none', margin: '0', color: 'red' }} id='errormsg' >Password's don't match</p>
                            <div>
                                <Input style={{ width: '100%' }} type='password' id='confirmPassword' placeholder='Confirm Password' required onChange={handlechange} />
                                <i>
                                    <span className="material-symbols-outlined" style={{ marginLeft: '-30px' }}>
                                        visibility
                                    </span>
                                </i>
                            </div>
                            <Button>Log In</Button>
                        </form>
                        <p style={{ textAlign: 'center' }}>
                            Have an account?
                            <button onClick={handlebuttonclick}
                                style={{ border: "none", background: 'none', fontSize: '15px', cursor: "grab" }}>
                                <a style={{ marginLeft: '1%' }} href='#'>
                                    Login.
                                </a>
                            </button>
                        </p>
                    </div>
                }
            </div>

        </div>
    )
}
